import React, { Component } from 'react';
import { Layout } from 'antd';


const { Header, Sider, Content } = Layout;

class Home extends Component {
    constructor(props) {
        super(props);

    }
    render() {

        return (
            <div>
                <Layout>
                    <Header>Header</Header>
                    <Content>Content</Content>
                    <Footer>Footer</Footer>
                </Layout >

            </div >

        );
    }

}

export default Home;
